import React from "react";

const Contact = () => {
  return (
    <section id="contact" style={{ padding: "40px 20px", backgroundColor: "#f9f9f9" }}>
      <h2>Contact Me</h2>
      <p>Email: <a href="mailto:your-email@example.com">your-email@example.com</a></p>
      <p>LinkedIn: <a href="https://linkedin.com/in/stanleychueh" target="_blank" rel="noopener noreferrer">linkedin.com/in/stanleychueh</a></p>
    </section>
  );
};

export default Contact;
